import React from 'react';
import './ex-5.css'
function Exercise5(){
   return( 

<div class='body'>
{/* flex */}
<div class="c1">
        {/* heading */}
       <div class='d1'>
        <strong style={{marginLeft:'550px'}}>Current Status: </strong>
          Started...
        </div>

        {/* subheading */}
        <div class="grid-container">
        <div class="grid-item"><button>STOP</button></div>
        <div class="grid-item"><button>RESET</button></div>
        <div class="grid-item"><label style={{fontSize:'10px'}}>Speed</label></div>
        </div>

        {/* subheading */}
        <h2 style={{textAlign:'center'}}>Events</h2>

        {/* displaying event details */}
        <div class="outerEventBox">
            <div class="innerEventBox">

            </div>

        </div>
</div>
</div>

   )
}

export default Exercise5;
